cat language.dsv         | psql postgres -c "copy exeta.i_language         (id, name)                                                                                                            from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat server.dsv           | psql postgres -c "copy exeta.i_server           (id, name, language_id)                                                                                               from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat schedule.dsv         | psql postgres -c "copy exeta.i_schedule         (id, name)                                                                                                            from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat schedule_node.dsv    | psql postgres -c "copy exeta.i_schedule_node    (schedule_id, position, schedule_node_type_id, value)                                                                 from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat task.dsv             | psql postgres -c "copy exeta.i_task             (id, name, task_type_id)                                                                                              from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat call.dsv             | psql postgres -c "copy exeta.i_call             (task_id, id, name)                                                                                                   from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat identifier_name.dsv  | psql postgres -c "copy exeta.i_identifier_name  (task_id, position, name, identifier_type_id)                                                                         from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat identifier_value.dsv | psql postgres -c "copy exeta.i_identifier_value (task_id, call_id, position, value)                                                                                   from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat feature.dsv          | psql postgres -c "copy exeta.i_feature          (call_id, task_id, position, name, value)                                                                             from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat rule.dsv             | psql postgres -c "copy exeta.i_rule             (call_id, task_id, rule_type_id, position, action_id, time, time_unit_id, iteration)                                  from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat call_node.dsv        | psql postgres -c "copy exeta.i_call_node        (task_id, id, call_node_type_id, call_id, parent_id, position)                                                        from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"
cat condition_node.dsv   | psql postgres -c "copy exeta.i_condition_node   (call_id, task_id, id, condition_node_type_id, condition_call_id, status_id, time, time_unit_id, parent_id, position) from stdin with (format csv, delimiter u&'\0007', quote u&'\0008', escape u&'\0008')"

